const ListTodos = () => {

    const getTodos = async () => {
        try {
            const response = await fetch("http://localhost:5000/todos");
            const jsonData = response.json();
            console.log(jsonData);
        } catch (error) {
            console.error(error.message);
            
        }
    }
    useEffect(()=> {
        getTodos();
    });

    return (
        <Fragment>
            <table class="table mt-5 text-center">
    <thead>
      <tr>
        <th>Description</th>
        <th>Edit</th>
        <th>Delete</th>
      </tr>
    </thead>
    <tbody>
        {/*       <tr>
